import './App.css';
import Home from './pages/Home';

import { BrowserRouter ,Route ,Routes} from 'react-router-dom'

function App() {

  return (


    <div className="App">

      <BrowserRouter>
      <div>
        <Routes>
          <Route path="/home" element={<Home/>} />
        </Routes>
        </div>
      </BrowserRouter>


    </div>
  );
}

export default App;
